import React from 'react'
import Postcreation from './postcreation'

function Home({posts}) {
  let ex=true
  console.log(posts)
  if(posts[0].got===false){
    ex=false
  }
  console.log(ex)
  return (
  [ ex&& <div  className='spacing overflow-y-scroll'>
      {posts.map((post)=>(
        <Postcreation key={post.id} post={post} ></Postcreation>
      ))}
    </div>,!ex&&<p key={posts.id} className='text-center mt-5 fs-3 spacing  text-danger'>No</p>]
    
  )
}

export default Home
